const getRecords = () => {
fetch('https://api.airtable.com/v0/app9VtXS1vJyLgLgK/OB%20Integration%20Requests', {
headers: {
    Authorization: `Bearer ${apiKey}`
  }
}).then(response => response.json()) 
    .then(records => console.log(records));

}

export default AirTable;
